import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomeHero from './components/HomeHero';
import Navbar from './components/navbar';
import Home from './Home';
import TruckerPage from './truckerPage';
import CargoBooking from './components/CargoBooking';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/truckUser/:uid" component={TruckerPage} />
          <Route path="/cargo-booking/:departureCity-:arrivalCity" component={CargoBooking} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
